userDefinedLinkHintCss:
.vimiumHintMarker {
  background: #21242b;
  border: 1.5px solid #51afef;
  border-radius: 5px;
  color: #bbc2cf;
  font-size: 12px;
  font-weight: 600;
  padding: 2px 5px;
}

.vimiumHintMarker .matchingCharacter {
  color: #ecbe7b;
  font-weight: 700;
}

#vomnibar {
  background: #21242b;
  border: 1.5px solid #51afef;
  border-radius: 8px;
}

#vomnibar input {
  background: #1b1f27;
  color: #bbc2cf;
}

#vomnibar li {
  padding: 5px 12px;
  color: #bbc2cf;
}

#vomnibar li.vomnibarSelected {
  background: #282c34;
  box-shadow: inset 3px 0 0 #51afef;
}
